import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div``

const Header = styled.div`
  disply: flex;
  justify-content: left;
  align-items: center;
  height: 5vw;
  border-bottom: 2px solid black;
`
const CompanyIcon = styled.img``

const HeaderTextBoxes = styled.div`
  disply: flex;
  justify-content: center;
  margin-left: 8vw;
`

const headerTexts = [
  '1. MAKE IT MOVE IN READY',
  '2. ABOUT YOU',
  '3. PITCH YOUR IDEA',
]

export const App = () => {
  return (
    <Wrapper>
      <Header>
        {headerTexts.map((item, idx) => {
          return <HeaderTextBoxes id={idx}> {item} </HeaderTextBoxes>
        })}
      </Header>
    </Wrapper>
  )
}
